import React from 'react';

const TaskOwner = (props) => {
    return (
        <div>
            I'm the task owner
            <label>Name: </label><input type="text" value = {props.name} />
            <label>Task: </label><input type="text" value = {props.task} />
        </div>
    );
}

export default TaskOwner;
